/*
    如果为数据结构，则返回数据引用名
* */
function beArray(matchStr){
    if(!matchStr || !matchStr.match(/\[\w+\]/g)){
        return null
    }
    return matchStr.slice(1,matchStr.length-1);
}

/*
    function discover
    key:数据源的路径字典（a.b.c.d）
    keyContainer:最终数据的引用名
    sources:数据源对象
* */
function discover(key,keyContainer){
    if(key == null || key == ''){
        return
    }
    var elemts = key.split('.');
    return done(elemts,keyContainer,sources);
};

function done(elemts,key,datas){
    var root = elemts.length;
    if(root<1){
        var swap ={}
        swap[key]=datas;
        return swap
    }
    if(_.isArray(datas)){
        var result = [];
        for(var i= 0;i<datas.length;i++)
        {
            result.push(done(elemts.slice(),key,datas[i]));
        }
        return result;
    }else if(_.isObject(datas)){
        var ele = elemts.shift();
        var value = datas[ele];

        //var obj={};
        //obj[ele]=done(elemts.slice(),key,value)
        return done(elemts.slice(),key,value)
    }else{
        var aa = {}
        aa[key] = datas
        return aa
    }
}

